description:
A crossover between &quot;Twin Peaks&quot; and &quot;Northern Exposure&quot;.
&quot;Timrot Ashan&quot; is an Israeli Thriller/Drama TV series, about the events surrounding the mysterious disappearance of the settlers of &quot;Timrot Ashan&quot;.

Filmed in the beautiful and pastoral Golan heights. In Hebrew.

